import './styles/login-table.sass';
import { faUser, faLock } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { useDispatch, useSelector } from 'react-redux';
import { setUsername } from './redux/login';

function LoginTable() {

    const { count } = useSelector((state) => state.login);
    const dispatch = useDispatch();

    setUsername = (username) => {
        dispatch(setUsername(username))
    }

    return (
        <div>
            <div className="container">
                <div className="input-container">
                    <input className="input" type="email" name="username" placeholder='Username' required></input>
                    <FontAwesomeIcon className="icon" icon={faUser} />
                </div>
                <div className="input-container">
                    <input className="input" type="password" name="password" placeholder='Password' required></input>
                    <FontAwesomeIcon className="icon" icon={faLock} />
                </div>
                <div className="button-container">
                    <button className="button">Sign In</button>
                </div>
            </div>
            <div className="shadow">
                <div className="shadow mirror"></div>
            </div>
        </div>

    );
  }

  export default LoginTable;
